    def OnclickResponderRandom(self):
            Censo = pymongo.MongoClient("mongodb://localhost:27017")
            db = Censo["Simulador"]
            tbl = db["tSimulador"]
            i = 0
            while (i < self.spinCantPersonas.value()):
                    if (self.spinDigiNumPre.value() == 1):
                            list = ["Es independiente", "En condominio", "En edificio de apartamento",
                                      "En vivienda tradicional indigena"
                                      "Es un cuarto en cuarteria", "Es un tugurio", "Persona en situacion de calle",
                                      "Otro"]
